import React from "react";
import "./style.css"

const MakeCall = () => {
    const socket = new JsSIP.WebSocketInterface(configuration.ws_servers);

    let configuration = {
        'uri': '704@admin', // FILL SIP URI HERE like sip:sip-user@your-domain.bwapp.bwsip.io
        'password': '704704', // FILL PASSWORD HERE,
        'sockets' : [ socket ]
    };
    let JsSIP = require('jssip');
    let ua = new JsSIP.UA(configuration);
    console.log('ua',ua);
    JsSIP.debug.enable('JsSIP:*'); // more detailed debug output


    return (

        <React.Fragment>
            <div id="callControl">
                <div id="to">
                    <input id="toField" type="text" placeholder="Enter number here"/>
                </div>
                <div id="connectCall"><i className="fa fa-phone"></i>

                </div>
            </div>
        </React.Fragment>
    )
};

export default MakeCall;
